        <Wrapper>
            <Hellotext> HELLO. </Hellotext>
            <Line>
                <Heading1> PROJECTS</Heading1>
                <Heading2> EDUCATION</Heading2>
                <Heading4> M.Sc in Media Technology and Engineering </Heading4>
